import React from "react";
import { Container } from "reactstrap";
import CategoryList from "./CategoryList";
import Navi from "./Navi";
import ProductList from "./ProductList";
import {Row} from "reactstrap";

function App() {
  return (
    <div>
      <Container>
        <Row>
          <Navi/>
        </Row>
        <Row>
          <CategoryList/>
          <ProductList/>
        </Row>
      </Container>
    </div>
  );
}

export default App;
